window.bookSummaryJSON = "<p>With Cole spiraling further out of control, Lexi must learn to rule the Shadow Realms while also finding a way to save him from the darkness.</p> <p>However, that’s difficult to do when the giants want their queen, enemies keep attacking, and Cole’s leaving an increasing number of bodies in his wake.</p> <p>The shadows have dug their way into Cole, filling him with their insatiable bloodlust. But if it helps keep Lexi safe, he’ll let them feast, even if it means losing more of himself.</p> <p>When a new, unforeseen enemy rises, everything they’ve fought for could be lost. Can Lexi and Cole find a way to save the realms without becoming monsters in the process?</p> <p>Return to the Shadow Realms. A world where vampires feast, lycans love deeply, dark fae seduce, witches cast their spells, dragons rule the skies, and treachery lurks around every corner.</p>"; 
